  <p><i><b>Jackson Browne</b></i> is the eponymous debut album of singer <a href="/wiki/Jackson_Browne" title="Jackson Browne">Jackson Browne</a> released in 1972. It peaked on the <a href="/wiki/Billboard_(magazine)" title="Billboard (magazine)">Billboard 200</a> chart at number 53.<sup id="cite_ref-BillboardAlbum_1-0" class="reference"><a href="#cite_note-BillboardAlbum-1">&#91;1&#93;</a></sup> Two singles were released with "<a href="/wiki/Doctor,_My_Eyes" title="Doctor, My Eyes">Doctor, My Eyes</a>" peaking at number 8 on the Pop Singles chart and "<a href="/wiki/Rock_Me_on_the_Water" title="Rock Me on the Water">Rock Me on the Water</a>" reaching number 48.<sup id="cite_ref-BillboardSingles_2-0" class="reference"><a href="#cite_note-BillboardSingles-2">&#91;2&#93;</a></sup>
  </p>
